import React from 'react';
import styled from 'styled-components';

const NavBar = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: #333;
  padding: 10px 20px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
`;

const NavButton = styled.button`
  background-color: #444;
  border: none;
  color: #fff;
  padding: 10px 15px;
  margin: 0 5px;
  border-radius: 5px;
  font-size: 0.9rem;
  transition: background-color 0.3s, transform 0.2s;

  &:hover {
    background-color: #555;
    transform: scale(1.05);
  }

  &:active {
    background-color: #666;
  }
`;

const MainContent = styled.div`
  padding: 50px;
  text-align: center;
  font-family: 'Roboto', sans-serif;
  color: #444;
`;

const Header = styled.h1`
  font-size: 2.5rem;
  color: #333;
  margin-bottom: 20px;
`;

const SubText = styled.p`
  font-size: 1.2rem;
  color: #777;
  margin-top: 15px;
`;

const MainPage = () => {
  return (
    <>
      <NavBar>
        <NavButton>Index</NavButton>
        <NavButton>Download</NavButton>
        <NavButton>Contact Us</NavButton>
        <NavButton>Help Center</NavButton>
        <NavButton>Search</NavButton>
        <NavButton>Login</NavButton>
      </NavBar>
      <MainContent>
        <Header>产品介绍</Header>
        <SubText>Welcome to CollectPie, the ultimate tool for collecting and managing your data efficiently.</SubText>
      </MainContent>
    </>
  );
};

export default MainPage;
